import React, { useState } from "react";

const Health = () => {
  const [items, setItems] = useState([]);

  const addItem = item => {
    items.push(item);
    setItems(items);
  };

  return (
    <button onClick={() => addItem("this")}>
      This
    </button>
  );
};

export default Health;
